script: |
  super -f text -I q7572.spq | sort > q7572.out

inputs:
  - name: q7572.spq
    data: |
      SELECT DISTINCT - ( - col0 ) AS col0 FROM tab2 (FORMAT parquet) WHERE + col2 NOT IN ( + 93 / 68 + 45 * col1 );
  - name: tab2

outputs:
  - name: q7572.out
    data: |
      46
      64
      75
